// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./MediaLibrary.sol";
import "./PriviNFT.sol";
import "./MediaFractionalizeManager.sol";

contract MediaManager is AccessControl {
    using Counters for Counters.Counter;
    using MediaLibrary for Media;

    Counters.Counter private _updateProposalIds;

    bytes32 public constant ADMIN = keccak256("admin");

    address public immutable priviNFTContractAddress;
    address public immutable priviSocialTokenAddress;
    address public immutable mediaFractionalizeManagerAddress;

    PriviNFT private immutable _priviNFT;
    ERC20 private immutable _priviSocialToken;
    MediaFractionalizeManager private immutable _mediaFractionalizeManager;

    // map from media to collabs
    mapping(uint256 => mapping(uint256 => ShareHolder)) private _collabs;
    // implement withdrawal pattern
    mapping(address => uint256) private pendingWithdrawals;

    event CreateMedia(address indexed creator, uint256 indexed mediaId);
    event Tip(address indexed from, uint256 indexed mediaId);

    constructor(
        address _priviNFTContractAddress,
        address _priviSocialTokenAddress,
        address _mediaFractionalizeManagerAddress
    ) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);

        priviNFTContractAddress = _priviNFTContractAddress;
        priviSocialTokenAddress = _priviSocialTokenAddress;
        mediaFractionalizeManagerAddress = _mediaFractionalizeManagerAddress;

        _priviNFT = PriviNFT(_priviNFTContractAddress);
        _priviSocialToken = ERC20(_priviSocialTokenAddress);
        _mediaFractionalizeManager = MediaFractionalizeManager(_mediaFractionalizeManagerAddress);
    }

    function createMedia(
        Media memory _media,
        string calldata _tokenURI,
        ShareHolder[] calldata _initialCollabs
    ) external {
        require(_media.royalty < MediaLibrary.SHARES_DENOMINATOR, "Invalid royalty");

        // the creators are the collabs
        // the owners are the collabs at the beginning
        _media.collabsSize = _initialCollabs.length > 0 ? uint80(_initialCollabs.length) : 1;
        _media.ownersSize = _media.collabsSize;

        uint256 mediaId = _priviNFT.createMedia(_media, _tokenURI);

        ShareHolder[] memory owners = new ShareHolder[](_media.collabsSize);

        // set the collaborators and owners in the creation
        if (_initialCollabs.length > 0) {
            uint256 totalShares;
            for (uint256 i; i < _initialCollabs.length; i++) {
                _collabs[mediaId][i] = _initialCollabs[i];
                totalShares += _initialCollabs[i].share;

                // set the owners as the collabs initially
                owners[i] = _initialCollabs[i];
            }
            require(totalShares == MediaLibrary.SHARES_DENOMINATOR, "Invalid total distributed shares");
        } else {
            // add the creator as collab with full shares and as the owner
            ShareHolder memory holder = ShareHolder({
                holderAddress: _media.creatorAddress,
                share: uint160(MediaLibrary.SHARES_DENOMINATOR)
            });
            _collabs[mediaId][0] = holder;
            owners[0] = holder;
        }

        _mediaFractionalizeManager.setInitialOwners(mediaId, owners);

        // emit the event if the creation was successful
        emit CreateMedia(_media.creatorAddress, mediaId);
    }

    // allows the viewer to tip to the owner
    function tipMedia(
        address _from,
        uint256 _mediaId,
        uint256 _amount
    ) external {
        // because the tip needs an approval proccess, the request should come from the ERC20 token
        require(msg.sender == priviSocialTokenAddress, "The tip should come from the ERC20 token");

        Media memory media = _priviNFT.getMedia(_mediaId);

        // get the amount through the allowance, the balance is already checked in the ERC20 contract
        _priviSocialToken.transferFrom(_from, address(this), _amount);

        uint256 fee;

        // check if has royalties and collaborator to distribute royalties for
        if (media.royalty > 0) {
            // get royalties
            Distribution[] memory royalties;
            (fee, royalties) = media.getRoyalties(_amount, _collabs[_mediaId]);

            // add to pending withdrawals
            for (uint256 i; i < royalties.length; i++) {
                pendingWithdrawals[royalties[i].holderAddress] += royalties[i].amount;
            }
        }

        // get owners and owners profit
        uint256 ownersProfit = _amount - fee;

        ShareHolder[] memory ownersWithShare = _mediaFractionalizeManager.getMediaOwners(_mediaId);

        // add to pending withdrawals
        for (uint256 i; i < ownersWithShare.length; i++) {
            pendingWithdrawals[ownersWithShare[i].holderAddress] +=
                (ownersWithShare[i].share * ownersProfit) /
                MediaLibrary.SHARES_DENOMINATOR;
        }

        // emit the event if the tip was successful
        emit Tip(_from, _mediaId);
    }

    // allow admins to see the collabs of a media
    function getMediaCollabs(uint256 _mediaId) external view onlyRole(ADMIN) returns (ShareHolder[] memory) {
        Media memory media = _priviNFT.getMedia(_mediaId);
        return media.getCollabs(_collabs[_mediaId]);
    }

    function withdraw() public {
        uint256 amount = pendingWithdrawals[msg.sender];
        require(amount > 0, "No pending withdrawals");

        pendingWithdrawals[msg.sender] = 0;
        _priviSocialToken.transfer(msg.sender, amount);
    }

    /**
     *   @TODO: methods to implement
     *   - openNFT
     *   - closeNFT
     *   - shareMedia
     */
}
